import React, { useEffect, useState } from 'react';
import axios from './axiosConfig';
import './App.css';
import { useParams } from 'react-router-dom';

const ConsentHistory = () => {
  const [history, setHistory] = useState([]);
  const { userId } = useParams();

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await axios.get(`/api/users/${userId}/consent-history`);
        setHistory(response.data);
      } catch (error) {
        console.error("Erro ao buscar hist贸rico de consentimento", error);
      }
    };

    fetchHistory();
  }, [userId]);

  return (
    <div className="consent-history-container">
      <h2>Hist贸rico de Consentimento</h2>
      {history.length > 0 ? (
        <ul>
          {history.map((entry) => (
            <li key={entry.id}>Consentimento dado em: {entry.date}</li>
          ))}
        </ul>
      ) : (
        <p>Nenhum hist贸rico de consentimento encontrado.</p>
      )}
    </div>
  );
};

export default ConsentHistory;
